        <option >All Books</option>
        <option >Reading</option>
        <option >Finished</option>
      </select>
      <div className="book-grid">
        {books.map((book) => (
          <Book
            key={book.title}
            title={book.title}
            year={book.publishedYear}
            author={book.author}
            theme={book.theme}
          />
        ))}
      </div>
    </div>
  );
}
